                                        <span style="" class="font-bold text-2xl capitalize text-blue-500">
                                            Amasser
                                        </span>
                                        <span class="font-bold text-sm italic">
                                            Si Obesesi Berlebih
                                        </span>
                                </div>
                            </div>
                        </div>
                        <div class="-mt-12 text-justify text-xs leading-8 text-gray-700">
                           Kalau kamu selalu merasa bahagia dan menikmati sekali momen saat mengelola keuangan dengan membagi uangmu secara proporsional untuk pengeluaran, tabungan, dan investasi, sudah pasti kamu tipe Amasser. Amasser adalah mereka yang sangat menyukai uang dan cenderung menyeimbangkan uang yang mereka miliki, baik untuk kebutuhan dan keinginan masa kini maupun masa depan. Kecenderungan utama mereka adalah bekerja keras dalam menghasilkan uang, berani mengambil risiko untuk menghasilkan keuntungan yang lebih besar dengan berinvestasi (risk taker), merasa dirinya punya kuasa atas uang yang dimiliki. Meskipun cenderung memiliki obsesi terhadap uang yang terlalu tinggi kadang membuat tipe ini menjadi terlalu khawatir terhadap pengelolaan keuangannya. Buat kamu yang masuk dalam kategori ini, pengelolaan keuanganmu sudah dipastikan baik, tapi ingat hidup kadang tidak selalu soal uang, kamu harus bisa menyeimbangkan obsesimu terhadap uang dengan pengembangan diri dan juga sosial.
