                        </div>
                    <div class="col-span-5">
                         <div class="relative " >
                            <span style="font-size:150px;" class="text-gray-300 font-bold capitalize">
                                A
                            </span>
                            <div class="absolute z-1 top-0 w-full h-full">
                                <div class="flex flex-col w-full h-full justify-center">
                                        <span style="" class="font-bold text-2xl capitalize text-blue-500">
                                            Avoider
                                        </span>
                                        <span class="font-bold text-sm italic">
                                          Si Nggak Pedulian
                                        </span>
                                </div>
                            </div>
                        </div>
                        <div class="-mt-12 text-justify text-xs leading-8 text-gray-700">
                          Siapa diantara kalian yang selalu sulit sekali mengelola keuangan? Mulai dari kesulitan untuk menyusun rencana keuangan, membuat catatan pengeluaran, hingga membayar tagihan tepat waktu? Jika ciri-ciri ini kamu banget, maka kamu termasuk dalam kategori Avoider! Avoider adalah mereka yang merasa tidak kompeten dan mudah kewalahan jika dihadapkan dengan hal-hal yang menyangkut uang. Bahkan mereka yang avoider cenderung tidak tahu atau tidak peduli dengan berapa banyak uang yang ia miliki, berapa banyak uang yang ia pinjam, hingga berapa banyak uang yang ia belanjakan. Tips utama buat avoider, ubah mindset kamu terhadap pengelolaan keuangan. Jangan jadikan pengelolaan keuangan menjadi sesuatu yang menakutkan, justru kamu harus menjadikan hal tersebut sesuatu yang dapat menjembatani kamu dengan tujuan hidupmu. Mulailah dengan langkah-langkah kecil untuk peduli terhadap keuanganmu seperti menyisihkan uang untuk ditabung saat menerima uang saku atau gaji, membuat pos pengeluaran sederhana, dan membayar tagihan yang menjadi kebutuhan utama secara tepat waktu.              
                        </div>
                    </div>
                 
                </div>
            </div>

             <div class="padding-content">
                <div class="grid grid-cols-7 gap-8">
                    <div class="col-span-5">
                         <div class="relative " >
                            <span style="font-size:150px;" class="text-gray-300 font-bold capitalize">
                               h
                            </span>
                            <div class="absolute z-1 top-0 w-full h-full">
                                <div class="flex flex-col w-full h-full justify-center">
                                        <span style="" class="font-bold text-2xl capitalize text-blue-500">
                                            Hoarder
                                        </span>
                                        <span class="font-bold text-sm italic">
                                           Si Nabung Melulu
                                        </span>
                                </div>
                            </div>
                        </div>
                        <div class="-mt-12 text-justify text-xs leading-8 text-gray-700">
                           Untuk kamu yang sangat hobi sekali menabung, mungkin kamu adalah hoarder. Hoarder adalah mereka yang suka menabung dan memprioritaskan tujuan keuangan mereka di atas segalanya. Mereka sangat suka sekali membuat perencanaan keuangan dan menikmati proses berkomitmen untuk menjalankan rencana tersebut, bahkan hoarder cenderung rutin mengevaluasi keuangan mereka secara berkala loh. Apa yang membedakan hoarder dengan amasser adalah mereka cenderung enggan menikmati uangnya untuk kebahagiaan diri sendiri dan orang lain serta takut untuk berinvestasi (risk averse). Bahkan hoarder memandang bahwa menghabiskan uang untuk kegiatan liburan, hiburan, bahkan shopping sebagai sesuatu yang tidak perlu. Meskipun kamu sangat gemar menabung dan memiliki perencanaan keuangan yang terkontrol, tetapi tidak ada salahnya loh menganggarkan pengeluaran untuk liburan, hiburan, bahkan shopping ke dalam perencanaan keuanganmu. Anggap saja itu sebagai hadiah kepada diri sendiri karena kamu telah konsisten terhadap rencana keuangan yang dibuat. 
                        </div>
